(25, 'about_us', '<p>Efficient transportation is an integral part of modern life. Getting where we need to be as quickly as possible is now a necessity, especially with our busy schedules.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If time is a concern, Levex is here to help. Our mission is to help busy people do more with their time. We achieve this through fast, efficient transportation and logistics services combined into one convenient app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hail a ride and get to your destination quickly and safely with Levex. Our partner riders are trained in safe riding methods for your sake. Plus, you can order food, groceries, medicine from the same app. Get your parcels delivered straight from your door to their destinations conveniently, too. Last but definitely not the least, enjoy the convenience of shopping online within Levex. Place orders and enjoy the convenience of paying cashless through the app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We also believe in helping our partner riders earn a living. Our partner riders enjoy the freedom to work at any time they want for as many or as few hours as they can. Earning is flexible, as riders can choose to fulfill more bookings for more income. We provide opportunities to everyone who wants to earn extra.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Levex&#39;s&nbsp;operating principles are opportunity and convenience. We give opportunities for our riders to make a living, and we provide convenience to our customers so they don&rsquo;t have to leave home often. Levex uses the power of technology for these good purposes.</p>', NULL, '2023-03-01 15:25:53'),
(26, 'privacy_policy', '<p>Our Privacy Policy was last updated on March 1, 2023.</p>\r\n\r\n<p>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\r\n\r\n<p>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.</p>\r\n\r\n<h2>Interpretation and Definitions</h2>\r\n\r\n<h3><strong>Interpretation</strong></h3>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h3><strong>Definitions</strong></h3>\r\n\r\n<p>For the purposes of this Privacy Policy:</p>\r\n\r\n<ul>\r\n	<li>&quot;<strong>Account</strong>&quot; means a unique account created for You to access our Service or parts of our Service.</li>\r\n	<li>&quot;<strong>Application</strong>&quot; means the software program provided by the Company downloaded by You on any electronic device, named Levex.</li>\r\n	<li>&quot;<strong>Company</strong>&quot; (referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Levex Express&nbsp;Philippines</li>\r\n	<li>&quot;<strong>Country</strong>&quot; refers to Philippines</li>\r\n	<li>&quot;<strong>Cookies</strong>&quot; are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</li>\r\n	<li>&quot;<strong>Device</strong>&quot; means any device that can access the Service such as a computer, a cell phone or a digital tablet.</li>\r\n	<li>&quot;<strong>Personal Data</strong>&quot; is any information that relates to an identified or identifiable individual.</li>\r\n	<li>&quot;<strong>Service</strong>&quot; refers to the features of the Application.</li>\r\n	<li>&quot;<strong>Service Provider</strong>&quot; means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.&nbsp;</li>\r\n	<li>&quot;<strong>Usage Data</strong>&quot; refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</li>\r\n	<li>&quot;<strong>You</strong>&quot; means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n</ul>\r\n\r\n<h2>Collecting and Using Your Personal Data</h2>\r\n\r\n<h3><strong>Types of Data Collected</strong></h3>\r\n\r\n<p><strong>Personal Data</strong></p>\r\n\r\n<p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<ul>\r\n	<li>Email address</li>\r\n	<li>First name and last name</li>\r\n	<li>Phone number</li>\r\n	<li>Address, State, Province, ZIP/Postal code, City</li>\r\n	<li>Usage Data</li>\r\n</ul>\r\n\r\n<p><strong>Usage Data</strong></p>\r\n\r\n<p>Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p>Usage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<p><strong>Information Collected while Using the Application</strong></p>\r\n\r\n<p>While using Our Application, in order to provide features of Our Application, We may collect, with Your prior permission:</p>\r\n\r\n<ul>\r\n	<li>Information regarding your location<br />\r\n	We use this information to provide features of Our Service, to improve and customize Our Service. The information may be uploaded to the Company&#39;s servers and/or a Service Provider&#39;s server or it may be simply stored on Your device.</li>\r\n	<li>You can enable or disable access to this information at any time, through Your Device settings.</li>\r\n</ul>\r\n\r\n<h2>Use of Your Personal Data</h2>\r\n\r\n<p>The Company may use Personal Data for the following purposes:</p>\r\n\r\n<ul>\r\n	<li><strong>To provide and maintain our Service</strong>, including to monitor the usage of our Service.</li>\r\n	<li><strong>To manage Your Account:</strong> to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</li>\r\n	<li><strong>For the performance of a contract: </strong>the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</li>\r\n	<li><strong>To contact You:</strong> To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</li>\r\n	<li><strong>To provide You with news</strong>, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</li>\r\n	<li><strong>To manage Your requests: </strong>To attend and manage Your requests to Us.</li>\r\n	<li><strong>For business transfers:</strong> We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</li>\r\n	<li><strong>For other purposes: </strong>We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</li>\r\n</ul>\r\n\r\n<p><strong>We may share Your personal information in the following situations:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>With Service Providers</strong>: We may share Your personal information with Service Providers to monitor and analyze the use of our Service, for payment processing, to contact You.</li>\r\n	<li><strong>For business transfers:</strong> We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</li>\r\n	<li><strong>With Affiliates:</strong> We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</li>\r\n	<li><strong>With business partners:</strong> We may share Your information with Our business partners to offer You certain products, services or promotions.</li>\r\n	<li><strong>With other users: </strong>when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside.</li>\r\n	<li><strong>With Your consent:</strong> We may disclose Your personal information for any other purpose with Your consent.</li>\r\n</ul>\r\n\r\n<h2>Retention of Your Personal Data</h2>\r\n\r\n<p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<h2>Transfer of Your Personal Data</h2>\r\n\r\n<p>Your information, including Personal Data, is processed at the Company&#39;s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to &mdash; and maintained on &mdash; computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p>\r\n\r\n<p>Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p>\r\n\r\n<p>The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p>\r\n\r\n<h2>Disclosure of Your Personal Data</h2>\r\n\r\n<h3><strong>Business Transactions</strong></h3>\r\n\r\n<p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<h3><strong>Law enforcement</strong></h3>\r\n\r\n<p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<h3><strong>Other legal requirements</strong></h3>\r\n\r\n<p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul>\r\n	<li>Comply with a legal obligation</li>\r\n	<li>Protect and defend the rights or property of the Company</li>\r\n	<li>Prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li>Protect the personal safety of Users of the Service or the public</li>\r\n	<li>Protect against legal liability</li>\r\n</ul>\r\n\r\n<h2>Security of Your Personal Data</h2>\r\n\r\n<p>The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p>\r\n\r\n<h2>Detailed Information on the Processing of Your Personal Data</h2>\r\n\r\n<p>The Service Providers We use may have access to Your Personal Data. These third-party vendors collect, store, use, process and transfer information about Your activity on Our Service in accordance with their Privacy Policies.</p>\r\n\r\n<h3><strong>Analytics</strong></h3>\r\n\r\n<p>We may use third-party Service providers to monitor and analyze the use of our Service.</p>\r\n\r\n<h3><strong>Email Marketing</strong></h3>\r\n\r\n<p>We may use Your Personal Data to contact You with newsletters, marketing or promotional materials and other information that may be of interest to You. You may opt-out of receiving any, or all, of these communications from Us by following the unsubscribe link or instructions provided in any email We send or by contacting Us.</p>\r\n\r\n<h2>Children&#39;s Privacy</h2>\r\n\r\n<p>Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.</p>\r\n\r\n<p>If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent&#39;s consent before We collect and use that information.</p>\r\n\r\n<h2>Links to Other Websites</h2>\r\n\r\n<p>Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party&#39;s site. We strongly advise You to review the Privacy Policy of every site You visit.</p>\r\n\r\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\r\n\r\n<h2>Changes to this Privacy Policy</h2>\r\n\r\n<p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<h2>Contact Us</h2>\r\n\r\n<p>If you have any questions about this Privacy Policy, You can contact us:</p>\r\n\r\n<ul>\r\n	<li>By visiting this page on our website: <a href=\"https://levex.ph/help-and-support\">https://levex.ph/help-and-support</a>&nbsp;</li>\r\n	<li>By sending us an email: <a href=\"mailto:support@levex.ph\">support@levex.ph</a></li>\r\n</ul>', NULL, '2023-03-01 15:24:49'),
