INSERT INTO `modules` (`id`, `module_name`, `module_type`, `thumbnail`, `status`, `stores_count`, `created_at`, `updated_at`, `icon`, `theme_id`, `description`, `all_zone_service`) VALUES
(1, 'Parcel Delivery', 'parcel', '2023-02-22-63f522d869a35.png', 1, 0, '2023-02-21 20:00:24', '2023-02-28 09:18:58', '2023-02-22-63f522d8650b7.png', 1, '<p>Getting your packages delivered is made even easier with LevEx. Normally, you have to drop off your package at a courier&#39;s branch before they can deliver it. Now, you don&rsquo;t have to leave home. LevEx will take care of both pickup and delivery.</p>\r\n\r\n<p>LevEx caters to parcels of different sizes. You can send anything from small documents to large boxes full of stuff. LevEx offers affordable delivery fees for packages of various sizes and weights.</p>\r\n\r\n<p>Our friendly riders will go to where you are, pick up your parcel, and send it to where it needs to be. We will keep your packages safe in transit until they reach their destinations.</p>', 0),
(2, 'Online Shopping', 'ecommerce', '2023-02-22-63f5234a2fffa.png', 1, 2, '2023-02-21 20:02:18', '2023-03-16 10:47:39', '2023-02-22-63f5234a2fa22.png', 1, '<p>LevEx brings you products from hundreds of our partner e-commerce sellers. You can browse their online storefronts from the app itself. Pick the products you want, order through the app, and wait for them to reach you, courtesy of our friendly riders.</p>\r\n\r\n<p>It&rsquo;s easy:</p>\r\n\r\n<ol>\r\n	<li>Browse LevEx&rsquo;s catalog of online stores.</li>\r\n	<li>Add the products you want to your cart.</li>\r\n	<li>Order and pay online or COD (cash on delivery).</li>\r\n	<li>Wait for your order to be delivered.</li>\r\n</ol>\r\n\r\n<p>LevEx&rsquo;s online stores are also much simpler to navigate than the rest. No fancy features. We are about simplifying the online shopping process.&nbsp;</p>\r\n\r\n<p>Our only mission is to bring the sellers&rsquo; products to you, the customers.</p>', 1),
(3, 'Food Delivery', 'food', '2023-02-22-63f523a53bd94.png', 1, 5, '2023-02-21 20:03:49', '2023-03-26 15:43:10', '2023-02-22-63f523a53b7d1.png', 2, '<p>With LevEx, you don&rsquo;t have to look elsewhere to satisfy your cravings. Choose from among our hundreds of partner restaurants and their selections of great food. Or you can find your favorite food straight from the app&rsquo;s search bar.</p>\r\n\r\n<p>Ordering food through LevEx is easy:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Choose a restaurant or search for one</p>\r\n	</li>\r\n	<li>\r\n	<p>Pick your food item</p>\r\n	</li>\r\n	<li>\r\n	<p>Pay online or through COD (cash on delivery)</p>\r\n	</li>\r\n	<li>\r\n	<p>Wait for our rider to deliver your order!</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>LevEx&rsquo;s partner restaurants offer a huge selection of menu items, from full meals to desserts. Grab a bite to eat at any time with LevEx.</p>', 1),
(4, 'Grocery', 'grocery', '2023-03-16-6412b289300d7.png', 1, 0, '2023-02-23 08:29:57', '2023-03-16 06:09:13', '2023-03-16-6412b2892fc48.png', 2, NULL, 1),
(5, 'Food Delivery 2', 'ecommerce', '2023-03-01-63ff5acb5d025.png', 0, 0, '2023-03-01 14:01:47', '2023-03-16 05:01:04', '2023-03-01-63ff5acb59451.png', 2, '<p>Lorem Ipsum</p>', 0),
(6, 'Food', 'ecommerce', '2023-03-02-64003e15aec55.png', 0, 1, '2023-03-02 06:11:33', '2023-03-02 07:00:33', '2023-03-02-64003e15aaaf6.png', 1, '<p>With LevEx, you don&rsquo;t have to look elsewhere to satisfy your cravings. Choose from among our hundreds of partner restaurants and their selections of great food. Or you can find your favorite food straight from the app&rsquo;s search bar.</p>\r\n\r\n<p>Ordering food through LevEx is easy:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Choose a restaurant or search for one</p>\r\n	</li>\r\n	<li>\r\n	<p>Pick your food item</p>\r\n	</li>\r\n	<li>\r\n	<p>Pay online or through COD (cash on delivery)</p>\r\n	</li>\r\n	<li>\r\n	<p>Wait for our rider to deliver your order!</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>LevEx&rsquo;s partner restaurants offer a huge selection of menu items, from full meals to desserts. Grab a bite to eat at any time with LevEx.</p>', 0),
(7, 'Pharmacy', 'pharmacy', '2023-03-16-6412b2bb54c9a.png', 1, 0, '2023-03-16 05:03:03', '2023-03-16 06:10:03', '2023-03-16-6412b2bb5495f.png', 2, '<p>pharmacy</p>', 0);
